
public class Relational {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10; // 10 value which will be stored into x variable
		int y = 20; // 20 value which will be stored into y variable
		System.out.println(x > y); //10>20 false
		System.out.println(x < y); //10<20 true
		System.out.println(x >= y); //10>=20 false
		System.out.println(x <= y); //10<=20 true
		System.out.println(x == y); //10==20 false
		System.out.println(x != y); //10!=20 true

	}

}
